const portfolioVideo = require("./../content/portfolio.mp4")
const img = require("./../content/projects/panaseer/hero-image.png")
function Home(props) {
  return (
    <div className="portfolio-item set-bg grow" style={{backgroundImage: "url(" + props.image + ")"}}>
    </div>
  );
}

export default Home;
